import React from 'react';

const Nav = () => {
    return (
        <div>
            <div className='flex'>
                    <img className='ml-20' src="https://scontent.xx.fbcdn.net/v/t1.15752-9/307698802_428372109285386_7426678966614564534_n.png?_nc_cat=107&ccb=1-7&_nc_sid=aee45a&_nc_ohc=vYAf2BYnJUcAX8rsVcB&_nc_ad=z-m&_nc_cid=0&_nc_ht=scontent.xx&oh=03_AVISQw17W0gYBQWx3Qznu6qE9IYOrF3EbTDx9sbFL3NSmQ&oe=635AE5E0" alt="" srcset="" />
                    <h1 className='mt-20 text-4xl font-bold'>ACTIVE-GYM-CLUB</h1>
                </div>
                <h2 className='ml-24  text-4xl mb-10'>
                    Select today's ecercise.....
                </h2>
        </div>
    );
};

export default Nav;
